const Header = () => {

    return (
        <header className="app-header">
            <a
                className="website-logo"
                href="https://dornsife.usc.edu"
                target="_blank"
                rel="noopener noreferrer"
            >
                <img src="https://i.ibb.co/pd2sBJk/logo.png" className="website-logo" alt="logo" />
            </a>

            <a
                className="department-link"
                href="https://dornsife.usc.edu/labs/cssl"
                target="_blank"
                rel="noopener noreferrer"
            >
                Morality and Language Lab (MOLA)
            </a>
        </header>
    );




};

export default Header;
